import React from "react";
import "./NewaccountButton.css"; // ← с маленькой 'a'

interface NewAccountButtonProps {
    onClick?: () => void;
    disabled?: boolean;
    loading?: boolean;
    children?: React.ReactNode;
}

export const NewaccountButton: React.FC<NewAccountButtonProps> = ({
                                                                      onClick,
                                                                      disabled = false,
                                                                      loading = false,
                                                                      children = "New account"
                                                                  }) => {
    return (
        <button
            type="button"
            className="new-account-button"
            onClick={onClick}
            disabled={disabled || loading}
        >
            {!loading && (
                <img
                    src={NewaccountButton}
                    alt="New account"
                    className="new-account-icon"
                />
            )}
            {loading ? "Loading..." : children}
        </button>
    );
};

export default NewaccountButton;
